def continuousYears(n):
    collection = copy.deepcopy(ALL)
    for key, value in ALL.items():
        if value != n:
            del collection[key]
    return collection

def countList():
    i = 0
    while True:
        result = continuousYears(i)

        if len(result.keys()) == 0:
            break
        print('Continuous {} year{}'.format(i, '.' if i < 2 else 's.'))
        print(result, end='\n\n\n\n')
        i = i + 1

def search(word=None):
    if not word:
        print('A search key word is missing.')
        exit()
    else:
        print('Search: {}'.format(word))
        for key, value in ALL.items():
            if word in key:
                print(key, value)
